import React from 'react'
import UserForm from '../forms/UserForm'
import { User } from '../interface/index'

interface Props {
  user: User
  showAuth: boolean
}
export default function EditProfile({ user, showAuth }): JSX.Element {
  return (
    <UserForm initialValues={user} showAuth={showAuth} />
  )
}
